import React from 'react';
import {PTitle, Body, Header, Flavor} from './style';
import {Buttons, HotButton} from '../Components/Body';



function WhatToWear() {  
  return (
    <Body>
        <PTitle>WhatToWear</PTitle>
        <Flavor>The Most Fail-Safe Weather App</Flavor>
        <Buttons>
          <a><HotButton>Visit</HotButton></a>
          <a><HotButton>GitHub</HotButton></a>
        </Buttons>
    </Body>

  );
}

export default WhatToWear;
